import React from "react";
import css from "./UncosElement.module.css";
import spotify from "../../../../img/spotify.png";

title;
author;
playlist;
timeline;
link;
img;

const PlaylistElement = (props) => {
  return (
    <div className={css.element}>
      <img src={props.img} />
      <div className={css.data}>
        <div className={css.title}>{props.title}</div>
        <div className={css.details}>
          <div className={css.author}>{props.author}</div>
          <div className={css.playlist}>{props.playlist}</div>
          <div className={css.timeline}>{props.timeline}</div>
        </div>
      </div>
      <img href={props.link} src={spotify} className={css.spotify} />
    </div>
  );
};

export default PlaylistElement;
